class Routes {
  static port = "7999";
  static init =
    "http://ec2-54-152-230-158.compute-1.amazonaws.com:" +
    Routes.port +
    "/api/init";
  static run =
    "http://ec2-54-152-230-158.compute-1.amazonaws.com:" +
    Routes.port +
    "/api/play/run";
  static createjob =
    "http://ec2-54-152-230-158.compute-1.amazonaws.com:" +
    Routes.port +
    "/api/createjob";
  static getAllRaw =
    "http://ec2-54-152-230-158.compute-1.amazonaws.com:" +
    Routes.port +
    "/api/play";
  static getRealtime =
    "http://ec2-54-152-230-158.compute-1.amazonaws.com:" +
    Routes.port +
    "/api/play/realtime";
  static getPreview =
    "http://ec2-54-152-230-158.compute-1.amazonaws.com:" +
    Routes.port +
    "/api/preview";
}

export default Routes;
